import axios from 'axios';
import React, { useEffect, useState, useRef } from 'react';
import VideosContainer from "./VideosWrapper"

const History: React.FC = () => {
  const [episodeNumber, setEpisodeNumber] = useState<number>(0);
  useEffect(()=>{
    axios.get(`/episodeNumber`)
      .then((res) => {
        setEpisodeNumber(res.data.episodeNumber);
      });
  },[]);
  const videoList = episodeNumber > 0 ? [...Array(episodeNumber.current)].map((x, i) =>
    <VideosContainer idx={i+1}/>
  ) : <></>;

  return (
    <div className="mx-auto mt-10">
      <div className="flex flex-col overflow-auto justify-items-center align-center h-4/5 px-6">
        {videoList}
      </div>
    </div>
  );
};

export default History;
